import Button from "@mui/material/Button";
import TextField from "@mui/material/TextField";

function FormSingUp() {
  return (
    <form>
      <TextField 
        id="name" 
        label="Nombres" 
        variant="outlined"
        fullWidth={true}
      />
      <TextField 
        id="lastname" 
        label="Apellidos" 
        variant="outlined"
      />
      <TextField 
        id="email" 
        label="Email" 
        variant="outlined"
      />

      <label>Promociones</label>
      <input type="Checkbox" />
      <label>Novedades</label>
      <input type="Checkbox" />
      <Button variant="contained">Registrarse</Button>
    </form>
  );
}

export default FormSingUp;
